import React, {Component} from 'react';
import Cart from './Cart.js';
import AddItem from './AddItem.js';
import { BrowserRouter as Router, Route, Link} from 'react-router-dom'


class App extends Component{

  constructor(props){
    super(props);
    this.state = {
      cartList: []
    }
  }

  componentDidMount() {
     fetch("http://jsonplaceholder.typicode.com/todos").then(data => data.json()).then(data =>this.setState({cartList: data})).catch(console.log);
  }
  render() {
    return (
      <Router>

      <div>
      <div className = "container">
        <div className = "col-xs-12">
          <h1>Welcome to Shop-R-US</h1>
          <div> <Link to="/Cart"/> View Cart <Link/></div>
          <div> <Link to="/AddItem"/> Add Items <Link/></div>
          <Cart cartList = {this.state.cartList}/>
          <AddItem item/>

        </div>
      </div>
      </div>
      </Router>
    );
  }

}

export default App;
